import React from "react";
import Seach from "../../components/Seach/index";
import NavBar from "../../components/NavBar/index";

function Home() {
    return (
             <div className="grid grid-cols-[13rem_auto] items-start h-screen">
                <NavBar />
                <main className="flex justify-center m-auto ">

                        <h1>Tela inicial (Home)</h1>

                   
                </main>
             </div>
    );
}

export default Home;
